import { Row } from 'reactstrap';
import TextCarousel from '../../global/carousel/TextCarousel';
import SystemInfo from '../system/SystemInfo';

import * as Styled from './Home.style'

function Home() {
    
    return (
      <Styled.Container>
        <Row>
          <Styled.CarouselContainer>
            <TextCarousel/>
          </Styled.CarouselContainer>
        </Row>
        </Styled.Container>
    );
}

export default Home
